import React from "react";
import "../styles/Dashboard.css";
import { useAuth } from "../contexts/AuthContext";

const Dashboard = () => {
  const { user } = useAuth();

  return (
    <div>
      <h1>Welcome to the Dashboard</h1>
      {user && (
        <>
          <p>You are logged in as {user.username}</p>
        </>
      )}
    </div>
  );
};

export default Dashboard;
